class Solution {
public:
    int findClosestNumber(vector<int>& nums) {
       int diff=INT_MAX,num;
        sort(nums.begin(),nums.end());
       for(int i=0;i<nums.size();i++)
       {
           if(abs(nums[i]-0)<=diff)
           {
              num=nums[i];
               diff=abs(nums[i]-0);
           }
       }
        return num;
    }
};
